import React from "react";
import {Link} from "react-router-dom";
export default function header() {
  return (
    <header style={headerStyle}>
      <h1>ToDo List Dashboard</h1>
      <Link style={linkStyle} to='/'>Home</Link>|<Link to='/about'>About</Link>
    </header>
  );
}
const headerStyle = {
  background: "#333",
  color: "#fff",
  textAlign: "center",
  margin: "10px",
};
